('ASUS Vivobook 16 A1605', 'Everything is smoother with the powerful ASUS Vivobook 16, the feature-packed laptop with user-friendly features including a 180° lay-flat hinge, a physical webcam shield and dedicated function keys to turn your mic on or off. Your health is in safe hands with ASUS Antimicrobial Guard Plus protecting frequently-touched surfaces, and the bigger touchpad is now more finger-friendly. Enjoy the smooth power of Vivobook 16!\r\n\r\nWindows 11 Home - ASUS recommends Windows 11 Home for business\r\nUp to Intel® Core™ 5 Series 1 processor\r\nUp to 16” NanoEdge display\r\nUp to 16 GB DDR4 memory\r\nUp to 512 GB SSD storage\r\nOptional fingerprint login sensor\r\nASUS Antimicrobial Guard Plus\r\nMilitary-Grade durability', 'ASUS Vivobook 16.png', 'Core 5 Processor 120U', 'INTEL', 1, 'Integrated Graphics', 'INTEL', 1, 16384, NULL, 524288, 'M2 SSD DDR5', NULL, NULL, 1920, 1200, NULL, NULL, NULL, NULL, 0, 1, 0),
